import React, {Component} from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import './Footer.css';



class Footer extends Component {
    render() {
        return (
            <Container fluid className="footer">
                <Row>
                    <Col xs={6} md={4}>
                        <div className="footerContent" id="footerContact">

                        </div>
                    </Col>
                    <Col xs={6} md={4}>
                        <div className="footerContent" id="footerAddress">

                        </div>
                    </Col>
                    <Col xs={6} md={4}>
                        <div className="footerContent" id="footerSocial">

                        </div>
                    </Col>
                    <Col xs={6} md={4}>
                        <div className="footerContent" id="footerLogo">

                        </div>
                    </Col>
                    <Col xs={6} md={4}>
                        <div className="footerContent" id="footerHours">

                        </div>
                    </Col>
                    <Col xs={6} md={4}>
                        <div className="footerContent">

                        </div>
                    </Col>
                </Row>

            </Container>
        )
    }   
}

export default Footer;
